import { API, SuspenseGet, wrapPromise } from 'utils/api';

// function fetchTopbanner() {
// 	return API.get('web/jobsFeed/advertisments');
// }

export const fetchUserProfile = ({ userId, jwt }) =>
	SuspenseGet({
		url: `web/profile/${userId}`,
		headers: {
			'x-access-token': jwt,
		},
	});
// wrapPromise(
// 	API.get(`web/profile/${userId}`, {
// 		headers: {
// 			'x-access-token': jwt,
// 		},
// 	}),
// );

export const fetchProfileData = ({ userId, jwt }) => ({
	baseProfile: fetchUserProfile({ userId, jwt }),
	resumeProfile: fetchUserProfile({ userId, jwt }),
});
